        return expense.date.getFullYear().toString() === filteredYear;
      });
    return (
        <div className="expenses">
            <Card className="expenses">
                <ExpenseFilter yearChanged={setNewYear}></ExpenseFilter>
            {props.item.map((expense)=>(<ExpenseItem title={expense.title} date={expense.date} amount={expense.amount} />))}
            </Card>
        </div>
    )
}

export default Expenses;
